import React from "react";
import "./home.css";

const Home = () => {
  return (
    <div className="grid-container">
      <div className="item2">Menu</div>
      <div className="item3">Main</div>
      <div className="item4">Right</div>
      <div className="item5">Footer</div>
      <div className="item1">Header</div>
    </div>
  );
};
export default Home;
